/* eslint-disable no-unused-vars */
import React, { useEffect, useState } from "react";
import {
  collection,
  getDocs,
  updateDoc,
  doc,
  addDoc,
  query,
  where,
} from "firebase/firestore";
import { db } from "../firebase";
import Swal from "sweetalert2";

const PartnerEarnings = () => {
  const [partners, setPartners] = useState([]);
  const [orders, setOrders] = useState([]);
  const [estimates, setEstimates] = useState([]);
  const [earningsInput, setEarningsInput] = useState({});

  // ðŸ”¹ Fetch all data
  useEffect(() => {
    const fetchData = async () => {
      const partnersSnap = await getDocs(
        query(collection(db, "partners"), where("approved", "==", true))
      );
      const ordersSnap = await getDocs(collection(db, "orders"));
      const estimatesSnap = await getDocs(collection(db, "estimates"));

      setPartners(partnersSnap.docs.map((d) => ({ id: d.id, ...d.data() })));
      setOrders(ordersSnap.docs.map((d) => ({ id: d.id, ...d.data() })));
      setEstimates(estimatesSnap.docs.map((d) => ({ id: d.id, ...d.data() })));
    };

    fetchData();
  }, []);

  // ðŸ”¹ Handle input changes
  const handleEarningChange = (partnerId, refId, value) => {
    setEarningsInput((prev) => ({
      ...prev,
      [partnerId]: {
        ...(prev[partnerId] || {}),
        [refId]: value,
      },
    }));
  };

  // ðŸ”¹ Save payout (for order or estimate)
  const savePayout = async (partner, entry, type) => {
    const refId = entry.id;
    const earning =
      earningsInput?.[partner.id]?.[refId] &&
      parseFloat(earningsInput[partner.id][refId]);

    if (!earning || isNaN(earning)) {
      Swal.fire("Please enter a valid amount!", "", "warning");
      return;
    }

    // Prepare details
    const serviceDetails =
      type === "order"
        ? entry.items
            ?.map((s) => `${s.name || "Unnamed Service"} â€” â‚¹${s.price || 0}`)
            .join(", ") || "No service data"
        : entry.services
            ?.map(
              (s) =>
                `${s.subCategory || s.description || "Unnamed"} â€” â‚¹${
                  s.totalAmount || s.labour_charge || 0
                }`
            )
            .join(", ") || "No service data";

    // Save to payouts collection
    await addDoc(collection(db, "payouts"), {
      partnerId: partner.id,
      partnerName: partner.name,
      partnerPhone: partner.phone,
      type,
      refId,
      orderId: entry.orderId || "N/A",
      amount: earning,
      serviceDetails,
      date: new Date(),
      status: "processed",
    });

    Swal.fire(
      "âœ… Payout Recorded!",
      `${type === "order" ? "Order" : "Estimate"} for ${
        partner.name
      }\nAmount: â‚¹${earning}`,
      "success"
    );
  };

  return (
    <div className="p-6">
      <h2 className="text-2xl font-bold mb-4">Partner Earnings</h2>

      <div className="space-y-8">
        {partners.map((partner) => {
          const completedOrders = orders.filter(
            (o) => o.partnerId === partner.id && o.status === "completed"
          );
          const approvedEstimates = estimates.filter(
            (e) => e.partnerId === partner.id && e.services?.some((s) => s.status === "approved")
          );

          return (
            <div
              key={partner.id}
              className="border rounded-lg p-4 shadow bg-white"
            >
              <h3 className="text-lg font-semibold mb-4">
                {partner.name} ({partner.phone})
              </h3>

              {/* Orders Section */}
              <h4 className="text-md font-semibold mb-2">Completed Orders</h4>
              {completedOrders.length > 0 ? (
                <table className="w-full border-collapse border border-gray-300 text-left mb-6">
                  <thead className="bg-gray-100">
                    <tr>
                      <th className="border p-2">Order ID</th>
                      <th className="border p-2">Services</th>
                      <th className="border p-2">Total Amount</th>
                      <th className="border p-2">Earning</th>
                      <th className="border p-2">Action</th>
                    </tr>
                  </thead>
                  <tbody>
                    {completedOrders.map((order) => (
                      <tr key={order.id}>
                        <td className="border p-2">{order.orderId}</td>
                        <td className="border p-2">
                          {order.items?.length ? (
                            order.items.map((s, i) => (
                              <div key={i}>
                                {s.name} â€” â‚¹{s.price}
                              </div>
                            ))
                          ) : (
                            <div>No items</div>
                          )}
                        </td>
                        <td className="border p-2">â‚¹{order.totalAmount || 0}</td>
                        <td className="border p-2">
                          <input
                            type="number"
                            className="border rounded p-1 w-24"
                            placeholder="Amount"
                            value={earningsInput?.[partner.id]?.[order.id] || ""}
                            onChange={(e) =>
                              handleEarningChange(
                                partner.id,
                                order.id,
                                e.target.value
                              )
                            }
                          />
                        </td>
                        <td className="border p-2">
                          <button
                            onClick={() => savePayout(partner, order, "order")}
                            className="bg-green-500 hover:bg-green-600 text-white px-3 py-1 rounded"
                          >
                            Process
                          </button>
                        </td>
                      </tr>
                    ))}
                  </tbody>
                </table>
              ) : (
                <p className="text-gray-500 mb-4">
                  No completed orders found.
                </p>
              )}

              {/* Estimates Section */}
              <h4 className="text-md font-semibold mb-2">Approved Estimates</h4>
              {approvedEstimates.length > 0 ? (
                <table className="w-full border-collapse border border-gray-300 text-left">
                  <thead className="bg-gray-100">
                    <tr>
                      <th className="border p-2">Estimate ID</th>
                      <th className="border p-2">Services</th>
                      <th className="border p-2">Total Amount</th>
                      <th className="border p-2">Earning</th>
                      <th className="border p-2">Action</th>
                    </tr>
                  </thead>
                  <tbody>
                    {approvedEstimates.map((estimate) => (
                      <tr key={estimate.id}>
                        <td className="border p-2">{estimate.orderId}</td>
                        <td className="border p-2">
                          {estimate.services?.map((s, i) => (
                            <div key={i}>
                              {s.subCategory || s.description} â€” â‚¹
                              {s.totalAmount || s.labour_charge || 0}
                            </div>
                          ))}
                        </td>
                        <td className="border p-2">
                          â‚¹
                          {estimate.services?.reduce(
                            (sum, s) =>
                              sum +
                              (s.totalAmount || s.labour_charge || 0),
                            0
                          )}
                        </td>
                        <td className="border p-2">
                          <input
                            type="number"
                            className="border rounded p-1 w-24"
                            placeholder="Amount"
                            value={earningsInput?.[partner.id]?.[estimate.id] || ""}
                            onChange={(e) =>
                              handleEarningChange(
                                partner.id,
                                estimate.id,
                                e.target.value
                              )
                            }
                          />
                        </td>
                        <td className="border p-2">
                          <button
                            onClick={() => savePayout(partner, estimate, "estimate")}
                            className="bg-blue-500 hover:bg-blue-600 text-white px-3 py-1 rounded"
                          >
                            Process
                          </button>
                        </td>
                      </tr>
                    ))}
                  </tbody>
                </table>
              ) : (
                <p className="text-gray-500">No approved estimates found.</p>
              )}
            </div>
          );
        })}
      </div>
    </div>
  );
};

export default PartnerEarnings;
